import React from "react";

const About = () => {
    return (
        <p className="about-me-text">A bachelor in IT who is passionate about UX/UI and web development. Has a great design eye,
        good social media and writing skills, likes to organize things and is careful and punctual.
        Gained a lot of team working skills from school projects and is experienced in promotion and marketing.</p>
    )
}

export default About;
